const root = ReactDOM.createRoot(document.getElementById('root'));  //---> Punto de entrada de la aplicaci칩n
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);  //---> En el punto de entrada se cargan los modulos y todo lo dem치s.

// If you want to start measuring performance in your app, pass a function
